B.Qc=new A.a4("What muscles were working hard to keep your hips up? If it was anything other than your glutes (butt muscles) as the primary muscle group you have a coordination issue in how your body is producing hip extension. Research has shown that back pain can often inhibit the activation of your glutes (they basically become turned off and stop functioning correctly). This has been termed to by Dr. Stuart McGill as \u201cgluteal amnesia.\u201d",null,null,null,null,null,null)
